import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import Routes from "./routes";

import Dashboard from "./pages/Dashboard";
import IncomingCall from "./components/IncomingCall";

function App() {
  return (
    <Router>
      <Dashboard>
        <Routes />
      </Dashboard>
      <IncomingCall />
    </Router>
  );
}

export default App;
